The midpoint of $(x_1,y_1)$ and $(x_2,y_2)$ would be $(\frac{x_1+x_2}{2},\frac{y_1+y_2}{2})$. If this midpoint was $(3, -2)$, and if one of the endpoints was $(1, 6)$, we would obtain a system of equations:
\begin{align*}
3&=\frac{x_1+x_2}{2}\\
-2&=\frac{6+y_2}{2}
\end{align*}
Solving for $x_1$, we have $x_1 = -1$.
And solving for $y_2$, we have $y_2 = -10$.
The second endpoint is then $\boxed{(-1,-10)}$.
